/** @jsx jsx */

import { jsx, css } from '@emotion/core';

import SurveyQuestion from 'components/SurveyQuestion';
import Header from 'components/Header';
import PastQuestions from 'constants/PastQuestions'

const pageArchivesStyle = css`
  max-width: 700px;

  .answer {
    padding: 0px 10px;
    font-family: 'apercu-light';
    height: 40px;
    text-align: left;
    color: #222222;
    display: flex;
    align-items: center;
    cursor: pointer;
    &:hover {
      background: rgba(196, 196, 196, 0.1);
    }
  }

  .answer-selected {
    background: #f3f2f2;
    &:hover {
      background: #f3f2f2;
    }
  }
  }
`;

function PageArchives() {
  const survey = PastQuestions;

  return (
    <div css={pageArchivesStyle}>
      <Header>ARCHIVES</Header>
      <div>Check out some selected questions from previous years!</div>
      <br />
      <div>
        {survey.map(question => (
          <SurveyQuestion question={question} />
        ))}
      </div>
    </div>
  );
}

export default PageArchives;
